(3, '<a title="Call me: +44 555 689 123">Call me: +44 555 689 123</a>', 'Phone', 'php_code'),
(4, '<?php global $base_url;?>\r\n<div class="widget-social">\r\n<ul>\r\n<li><a href="#vimeo" title="Watch my videos" style="background-image: url(<?php print $base_url.''/''.drupal_get_path(''theme'', ''bestmobile''); ?>/img/bright/social/vimeo.png);">Watch my videos</a></li>\r\n<li><a href="#facebook" title="Like me" style="background-image: url(<?php print $base_url.''/''.drupal_get_path(''theme'', ''bestmobile''); ?>/img/bright/social/facebook.png);">Like me</a></li>\r\n<li><a href="#picasa" title="My photos" style="background-image: url(<?php print $base_url.''/''.drupal_get_path(''theme'', ''bestmobile''); ?>/img/bright/social/picasa.png);">My photos</a></li>\r\n<li><a href="#twitter" title="Follow me" style="background-image: url(<?php print $base_url.''/''.drupal_get_path(''theme'', ''bestmobile''); ?>/img/bright/social/twitter.png);">Follow me</a></li>\r\n<li><a href="#dribbble" title="Dribbling" style="background-image: url(<?php print $base_url.''/''.drupal_get_path(''theme'', ''bestmobile''); ?>/img/bright/social/dribbble.png);">Dribbling</a></li>\r\n<li><a href="#mixx" title="Mixx" style="background-image: url(<?php print $base_url.''/''.drupal_get_path(''theme'', ''bestmobile''); ?>/img/bright/social/mixx.png);">Mixx</a></li>\r\n<li><a href="#rss" title="RSS" style="background-image: url(<?php print $base_url.''/''.drupal_get_path(''theme'', ''bestmobile''); ?>/img/bright/social/rss.png);">RSS</a></li>\r\n</ul>\r\n</div>', 'Social Box', 'php_code'),
(5, '<div class="widget-twitter" data-username="themesnap" data-count="4" data-retweets="true">\r\n<div class="tweets"></div>\r\n</div>', 'Latest tweets', 'php_code'),
(6, '<div class="widget-flickr" data-id="31408169@N04" data-count="8">\r\n<ul class="photos"></ul>\r\n</div>', 'Photo stream', 'php_code'),
(7, '<div class="widget-info">\r\n<hgroup>\r\n<h1>Website</h1>\r\n<h2>Responsive Drupal<br />mobile theme</h2>\r\n</hgroup>\r\n</div>', 'Info', 'php_code'),
(8, '<div class="widget-twitter" data-username="themesnap" data-count="2" data-retweets="true">\r\n<div class="tweets"></div>\r\n</div>', 'Latest tweets footer', 'php_code'),
(9, '<p>\r\nemail: <a href="mailto:themes@kubasto.com">themes@kubasto.com</a><br />\r\n+48 555 22 11 (Tomy&nbsp;Lee&nbsp;Jones)<br />\r\n+48 555 65 65 (John&nbsp;Malkovich)\r\n</p>\r\n<p>\r\nSesame Street 1<br />\r\n00-525 New York\r\n</p>', 'Address', 'php_code'),
(10, '<?php global $base_url;?>\r\n<img src="<?php print $base_url.''/''.drupal_get_path(''theme'', ''bestmobile''); ?>/img/icons/32/shipping.png" alt="" class="icon" />\r\n<h1>Featured text</h1>\r\n<p>Consectetuer, exquo novum saperet fierent. Nobis dehhag asilenit novim. Nosed denique um, sedsit theophrastus, cumei graeci discere impeditus ad tesmel. <a href="#_" class="more">More</a></p>', 'Featured text', 'php_code'),
(11, '<?php global $base_url;?>\r\n<img src="<?php print $base_url.''/''.drupal_get_path(''theme'', ''bestmobile''); ?>/img/icons/32/bestseller.png" alt="" class="icon" />\r\n<h1>Aenean mass</h1>\r\n<p>Eum idiudicabit nadeo sedvel duis voluptaria ne. Eum idiudicabit no sed denique mnesarchum, seicad nemis iudicicaabit theophrastus, cumeipria nicae eum ididicabit. <a href="#_" class="more">More</a></p>', 'Aenean mass', 'php_code'),
(12, '<?php global $base_url;?>\r\n<img src="<?php print $base_url.''/''.drupal_get_path(''theme'', ''bestmobile''); ?>/img/icons/32/customers.png" alt="" class="icon" />\r\n<h1>Socis natoque</h1>\r\n<p>Suscipiantur consetuer, exquo sacrem saperet fierentens. Conse ctetuer, exquo novum satepor fierent. Nobis dehhag asilenit novim. Nosed denique umtheos. <a href="#_" class="more">More</a></p>', 'Socis natoque', 'php_code'),
(13, '<?php global $base_url;?>\r\n<img src="<?php print $base_url.''/''.drupal_get_path(''theme'', ''bestmobile''); ?>/img/icons/32/communication.png" alt="" class="icon" />\r\n<h1>Ultricies nec</h1>\r\n<p>Quisque rutrum. Aenean imperdiet. Etiam ultricies nisi vel augue. Curabitur ullamcorper ultricies nisi. Nam eget dui. Etiam rhoncus. Maecenas tempus, tellus. <a href="#_" class="more">More</a></p>', 'Ultricies nec', 'php_code'),
(14, '<a href="#">\r\n<img src="/" data-src="content/banner-second.jpg" class="responsive" data-side="both" alt="" />\r\n<span class="caption white">Additional banner</span>\r\n</a>', 'Additional banner', 'php_code'),
(15, '<a href="#">\r\n<img src="/" data-src="content/banner-third.jpg" class="responsive" data-side="both" alt="" />\r\n<span class="caption white">Third banner (also customizable)</span>\r\n</a>', 'Third banner', 'php_code'),
(16, '<figure class="alignleft full-width-mobile" style="width: 20%;">\r\n<img src="/" data-src="content/photo06.jpg" alt="" class="responsive" />\r\n</figure>\r\n<p>The contact form below works out-of-the box (including validation). It''s included in the <a href="http://themeforest.net/item/website-responsive-template/993139/?ref=kubasto">template</a>, of course.</p>\r\n<p>Maecenas nec odio et ante tincidunt tempus. Donec vitae sapien ut libero venenatis faucibus. Nullam quis ante. Etiam sit amet orci eget eros faucibus tincidunt. Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem.</p>\r\n<hr />', 'Contact form', 'php_code');
