('node', 'slide', 0, 29, 29, 'und', 0, '<h1>Slider Text</h1>\r\n<p>There are 3 different slider layouts. This is a slider with extra text on the right side. Add or edit any text that appears here just by clicking the "Content" and then editing the "Slide 1," "Slide 2," etc. Choose from a full width slider that spans this entire width or choose a medium slider with two banners placed to the right. All sliders are "touch gestures" friendly (for tablet and smartphone users).</p>', '', 'full_html'),
